INSERT INTO `posts` (`id`, `title`, `slug`, `url`, `blog_id`, `image_url`, `description`, `is_active`, `hits_count`, `created`, `updated`) VALUES
(1, 'Emma Lohoues au festival de Cannes', 'emma-lohoues-au-festival-de-cannes', 'http://afriwood.akendewa.net/actu/emma-lohoues-au-festival-de-cannes/', 1, 'http://afriwood.akendewa.net/wp-content/uploads/2012/05/emmalohouescannes3-300x225.jpg', 'L''actrice ivoirienne Emma Lohoues est au Festival de Cannes dans le cadre de la promotion du Film Le Mec Idéal qui est projeté hors compétition. Quelques photos de son séjour... Tags: Emma Lohoues, Festival de Cannes, Mec idéal', 1, 0, '2012-05-25 19:45:42', '2012-05-27 05:58:01'),
(2, 'AURELIE ELIAM REJOINT L’EQUIPE DE LIFE', 'aurelie-eliam-rejoint-l-equipe-de-life', 'http://afriwood.akendewa.net/actu/aurelie-eliam-rejoint-lequipe-de-life/', 1, 'http://afriwood.akendewa.net/wp-content/uploads/2012/05/aurelieeliamlife-230x300.jpg', 'L''actrice ivoirienne, Aurélie Eliam, plus connue pas ses fans sous le nom de Alice Bamba, personnage qu''elle incarnait dans la série Dr Boris, vient d''ajouter une autre corde à son arc. Actrice, mannequin, Présentatrice d''émission télé, elle est désormais', 1, 0, '2012-05-22 02:47:36', '2012-05-27 05:57:53'),
(3, 'LE COMPTE TWITTER DE GENEVIEVE NNAJI CERTIFIE', 'le-compte-twitter-de-genevieve-nnaji-certifie', 'http://afriwood.akendewa.net/actu/le-compte-twitter-de-genevieve-nnaji-certifie/', 1, '', 'Peu de nigérians ont leur compte twitter certifié(la petite icône bleue). Genevieve Nnaji, talentueuse actrice lauréate de multiples récompenses et véritable icône de l''industrie cinématographique nigériane vient de rejoindre ce cercle de " Happy Few ". T', 1, 0, '2012-05-19 03:17:27', '2012-05-27 05:58:05'),
(4, 'BABI, le court-métrage ivoirien qui a fait le buzz', 'babi-le-court-metrage-ivoirien-qui-a-fait-le-buzz', 'http://afriwood.akendewa.net/actu/babi-le-court-metrage-ivoirien-qui-a-fait-le-buzz/', 1, '', 'Le cinéma ivoirien est pauvre en production dit-on. Mais le plus grave, c''est qu''il manque encore plus de production de qualité. On ne peut pas faire ce reproche au court-métrage BABI de la jeune réalisatrice ivoirienne Siam Marley.', 1, 0, '2012-05-18 04:10:15', '2012-05-27 05:58:13'),
(5, 'Le Mec Idéal', 'le-mec-ideal', 'http://afriwood.akendewa.net/revue/le-mec-ideal/', 1, '', 'Une histoire qu''on a tous déjà entendue, mais racontée avec les bons ingrédients...et une bonne dose d''humour. RESUME: Marcus travaille dans un pressing et circule à vélo dans la capitale ivoirienne. Sans voiture, sans argent, va-t-il pouvoir séduire la b', 1, 0, '2012-05-17 09:58:03', '2012-05-27 05:58:10'),
(6, 'Un an de plus pour Alain Guikou', 'un-an-de-plus-pour-alain-guikou', 'http://afriwood.akendewa.net/actu/un-an-de-plus-pour-alain-guikou/', 1, 'http://afriwood.akendewa.net/wp-content/uploads/2012/05/anniversairealainguikou-300x200.jpg', 'Le réalisateur Ivoirien Alain Guikou, à qui l''on doit la série " Signature " a eu un an de plus le 13 Mai. Pour fêter l''évènement, il était entouré d''autres grands noms du cinéma ivoirien, le réalisateur Owell Brown dont le film " Le mec idéal " fait un c', 1, 0, '2012-05-17 05:27:10', '2012-05-27 05:58:16'),
(7, 'Distance Between', 'distance-between', 'http://afriwood.akendewa.net/revue/distance-between/', 1, 'http://2.bp.blogspot.com/_SpN-ObXBUUY/Sk8lguK6LWI/AAAAAAAAAW8/hKJjmMmqNSQ/s320/3262875313_5877507129_m.jpg', 'Acteurs: Rita Dominic, Mercy Johnson, Kalu Ikeagwu, Yemi Blaq Le film met en scène la vie de deux jeunes femmes, Mosun et Preye toute deux victimes d''abus sexuels dans leur enfance. La première violée par son beau-père et la seconde par son Oncle.', 1, 0, '2012-05-17 04:33:02', '2012-05-27 05:58:24'),
(8, 'Last Offense', 'last-offense', 'http://afriwood.akendewa.net/revue/last-offense/', 1, 'http://3.bp.blogspot.com/_SpN-ObXBUUY/SfQgDcSnEWI/AAAAAAAAAS0/5ckJtS2jeVY/s400/1236949089849429236316.jpg', 'Acteurs: Rita Dominic, Oge Okoye, Mike Ezuruonye Ce film porte bien son nom: LAST OFFENSE! C''était vraiment la dernière offense que l''on puisse faire à un téléspectateur et surtout un fan de RITA DOMINIC. Résumé: Princess Agu , fille unique d''un riche ban', 1, 0, '2012-05-17 04:10:41', '2012-05-27 05:58:28'),
(9, 'Bienvenue sur Afriwood', 'bienvenue-sur-afriwood', 'http://afriwood.akendewa.net/actu/6/', 1, 'http://afriwood.akendewa.net/wp-content/uploads/2012/05/yehnidjidji-189x300.jpg', 'Après avoir initié le mois littéraire en Juillet 2011 sur mon blog http:/ /yehnidjidji.blogspot.com/ et essayer de mieux connaître et comprendre la chaîne du livre, je souhaitais cette année, mettre en avant le cinéma ivoirien. Pendant un mois, interviewe', 1, 0, '2012-05-17 03:14:06', '2012-05-27 05:58:32'),
(10, 'Googirls dans la place', 'googirls-dans-la-place', 'http://famchocolat.wordpress.com/2012/05/19/googirls-dans-la-place/', 5, 'http://famchocolat.files.wordpress.com/2012/05/googirls.jpg?w=300&h=300', 'Il y a quelques jours, Abidjan recevait une délégation de 22 dans le cadre des GoogleDays. Cinq jours avant cet évènement, je tombais par hasard sur un maquis-bar-resto de la commune de yopougon, au nom insolite de Google Life . Joli clin d''œil à cet impo', 1, 0, '2012-05-19 08:29:33', '2012-05-27 05:58:02'),
(11, 'JNTIC Abidjan: Femmes tissons notre toile…', 'jntic-abidjan-femmes-tissons-notre-toile', 'http://famchocolat.wordpress.com/2012/05/17/jntic-abidjan-femmes-tissons-notre-toile/', 5, 'http://famchocolat.files.wordpress.com/2012/05/akendewa-jntic.jpg?w=300&h=300', 'Depuis 2 jours, se déroulent à Abidjan les Journées Nationales des Technologies de l''Information et de de la Communication. Cette année, ces JNTIC ont pour thème principal: "LES FEMMES ET LES FILLES DANS LE SECTEUR DES TIC". Faute de temps je n''ai, jusqu''', 1, 0, '2012-05-17 09:01:06', '2012-05-27 05:58:19'),
(12, 'Etancher sa soif du web via Google…', 'etancher-sa-soif-du-web-via-google', 'http://famchocolat.wordpress.com/2012/05/10/etancher-sa-soif-du-web-via-google/', 5, 'http://famchocolat.files.wordpress.com/2012/05/google1.jpg?w=300&h=300', 'Aux détours d''une rue ce soir je suis tombée sur un Maquis-Bar-Restaurant insolite et n''ai donc pas pu m''empêcher de prendre une petite photo de l''enseigne... Depuis l''ascension des réseaux sociaux, on peut voir dans les rues d''Abidjan des noms de bars (e', 1, 0, '2012-05-10 17:44:45', '2012-05-27 05:58:36'),
(13, '1 POINT FOR HOLLANDE: SO WHAT??????', '1-point-for-hollande-so-what', 'http://famchocolat.wordpress.com/2012/05/06/1-point-for-hollande-so-what/', 5, 'http://famchocolat.files.wordpress.com/2012/05/francois-hollande.jpg?w=300&h=300', 'Je ne voulais pas m''attarder sur la présidentielle française hein...mais une seule question m''est venue à l''esprit au moment de la proclamation des résultats:- SO WHAT???? J''applaudirai à ce genre de résultats, lorsqu''un jour dans MON PAYS:- On n''entendra', 1, 0, '2012-05-06 14:48:02', '2012-05-27 05:58:40'),
(14, 'MARCHANDS AMBULANTS, MALHONNETETE DEAMBULANTE!!!', 'marchands-ambulants-malhonnetete-deambulante', 'http://famchocolat.wordpress.com/2012/04/27/marchands-ambulants-malhonnetete-deambulante/', 5, '', 'Demandez moi si j''ai bien dormi la nuit dernière et je répondrai oui...MAIS... Comme beaucoup de gens, je n''aime pas laisser une bonne affaire passer sous mon nez... Bah c...', 1, 0, '2012-04-27 16:31:45', '2012-05-27 05:58:45'),
(15, 'CHELSEA vs BARCA : LA COTE D’IVOIRE EST QUALIFIEE', 'chelsea-vs-barca-la-cote-d-ivoire-est-qualifiee', 'http://famchocolat.wordpress.com/2012/04/24/chelsea-vs-barca-la-cote-divoire-est-qualifiee/', 5, 'http://famchocolat.files.wordpress.com/2012/04/chelsea.jpg?w=300&h=300', 'Il y a quelques minutes: des grands cris d''effervescence!!! Chelsea, "l''une des villes les plus réputées de Cote d''Ivoire" doit y être pour quelque chose. Moi intérieurement: - le foot je m''en tape! N''empêche que le phénomène ivoiro-chelsico-drogbatique n', 1, 0, '2012-04-24 17:53:54', '2012-05-27 05:58:50'),
(16, 'A chacun sa “viande” de Pâques', 'a-chacun-sa-viande-de-paques', 'http://famchocolat.wordpress.com/2012/04/09/a-chacun-sa-viande-de-paques/', 5, 'http://famchocolat.files.wordpress.com/2012/04/img00078-20120409-1033.jpg?w=300&h=300', 'Ce matin au marché pendant que j''étais entrain d''acheter de la viande de bœuf, une femme assez présentable, sûrement la cinquantaine avancée, est venue avec sa fille demander au boucher la permission de récupérer les déchets de viande qu''il avait jeté sou', 1, 0, '2012-04-09 19:48:26', '2012-05-27 05:58:54'),
(17, 'ABIDJAN CHAUFFARD', 'abidjan-chauffard', 'http://famchocolat.wordpress.com/2012/04/02/abidjan-chauffard/', 5, 'http://famchocolat.files.wordpress.com/2012/04/taximan-inconscient.jpg?w=300&h=300', '7h30 ce matin. Je suis sensée être au boulot, mais manque de pot pour moi et les personnes dans la longue file d''attente du waren qui attendons depuis plus de trois quarts d''heure: AUCUN TAXI A L''HORIZON!!! 7h35: La joie! Je fais partie des chanceux qui p', 1, 0, '2012-04-02 16:38:36', '2012-05-27 05:58:59'),
(18, 'LUTTER POUR REUSSIR UN JOUR…', 'lutter-pour-reussir-un-jour', 'http://famchocolat.wordpress.com/2012/03/28/lutter-pour-reussir-un-jour/', 5, 'http://famchocolat.files.wordpress.com/2012/03/img00060-20120328-0659.jpg?w=300&h=300', '"Travaillez, prenez de la peine, c''est l''effort qui marque les points..." J''aime beaucoup ce refrain d''une vieille chanson du congolais-belge Papa Wemba. Mais face a certaines scènes de la vie quotidienne je me pose souvent la question de la fameuse "pein', 1, 0, '2012-03-28 03:55:37', '2012-05-27 05:59:02'),
(19, 'STATISTIQUES…”ATTRAPE-MENTEURS”', 'statistiques-attrape-menteurs', 'http://famchocolat.wordpress.com/2012/03/24/statistiques-attrape-menteurs/', 5, 'http://famchocolat.files.wordpress.com/2012/03/statistique.jpg?w=300&h=300', 'Une mauvaise habitude que beaucoup de gens ont sur les deux principaux réseaux sociaux bleus, c''est de cliquer sur "J''aime" OU "Retweeter" un lien qu''ils n''auront même pas consulté et qu''il est certain qu''ils n''auront pas le temps de le faire plus tard...', 1, 0, '2012-03-24 19:01:05', '2012-05-27 05:59:05'),
(20, 'À propos de la passion', 'a-propos-de-la-passion', 'http://feedproxy.google.com/~r/jpehouman/~3/iwMJO8DKqhQ/francais-a-propos-de-la-passion', 6, 'http://www.jpehouman.com/wp-content/uploads/2012/05/fruit-passion-300x230.jpg', 'La passion permet d''atteindre le plus haut niveau de ce que vous faites. Atteindre l''excellence dans un domaine, résulte en partie d''une passion prononcée pour ce que vous faites. Lorsque vous prenez le temps d''apprendre et de vous exercez avec passion vo', 1, 1, '2012-05-27 04:21:30', '2012-05-27 15:41:24'),
(21, 'La méthode ORMAD au secours des développeurs africains', 'la-methode-ormad-au-secours-des-developpeurs-africains', 'http://feedproxy.google.com/~r/jpehouman/~3/wS7bg0_lT_c/la-methode-ormad-au-secours-des-developpeurs-africains', 6, '', 'A prendre en compte : Dans ce qui suit, le mot "système" est utilisé pour identifier un logiciel, une application, un serveur, une technologie, ..., tout ensemble de fichiers permettant une exécution automatique d''une tache par un ordinateur. La semaine d', 1, 0, '2012-05-24 10:11:51', '2012-05-27 06:02:39'),
(22, 'Développons pour les femmes', 'developpons-pour-les-femmes', 'http://feedproxy.google.com/~r/jpehouman/~3/UFWZVzvKamg/developpons-pour-les-femmes', 6, 'http://www.jpehouman.com/wp-content/uploads/2012/05/tech-needs-girls.png', 'Développons pour les femmes Hier, 17 Mai 2012, était la les journée mondiale des Technologies de l''Information et de la Communication. Pour cette année, le thème était "Women and Girls in Technologies". Ce qui donne litteralement en francais " femmes et l', 1, 0, '2012-05-18 05:19:38', '2012-05-27 06:03:01'),
(23, 'La republique twitterofile de Côte d’Ivoire : les hommes politiques et les médias sociaux', 'la-republique-twitterofile-de-cote-d-ivoire-les-hommes-politiques-et-les-medias-sociaux', 'http://feedproxy.google.com/~r/jpehouman/~3/Ls-xwLWiCts/la-republique-twitterofile-de-cote-divoire-les-hommes-politiques-et-les-medias-sociaux', 6, 'http://www.jpehouman.com/wp-content/uploads/2012/05/twitter-repubique-300x225.jpg', 'Ce matin j''ai souhaité produire quelques chiffres sur les usages de twitter en Côte d''Ivoire. Je vais donc vous faire : Une liste des tags les plus utilisé par les ivoiriens (avec des stats) Une liste des hommes politiques utilisant twitter + facebook +bl', 1, 0, '2012-05-08 06:28:00', '2012-05-27 06:04:35'),
(24, 'L’ afritechpreneur face à la difficulté', 'l-afritechpreneur-face-a-la-difficulte', 'http://feedproxy.google.com/~r/jpehouman/~3/wHHwVSQOivw/l-afritechpreneur-face-a-la-difficulte', 6, 'http://www.jpehouman.com/wp-content/uploads/2010/11/baobab-225x300.jpg', 'L''afritechpreneurs doit-il capituler face à ces difficultés propres à l''Afrique ? Je pense que non. Bien au contraire il devrait redoubler d''ingéniosité pour contourner ces barrières. Car une fois ces difficultés contournées, il ne lui reste plus qu''un im', 1, 0, '2012-03-27 03:30:37', '2012-05-27 06:04:42'),
(25, 'Emploi – En Côte d’Ivoire, la fonction Publique recrute 200 informaticiens du 19 au 30 Mars 2012', 'emploi-en-cote-d-ivoire-la-fonction-publique-recrute-200-informaticiens-du-19-au-30-mars-2012', 'http://feedproxy.google.com/~r/jpehouman/~3/KQ70N4Iak0s/emploi-en-cote-divoire-la-fonction-publique-recrute-200-informaticiens-du-19-au-30-mars-2012', 6, 'http://www.jpehouman.com/wp-content/uploads/2012/03/communiquee_concour_informaticien-203x300.jpg', 'C''est une bonne nouvelle pour les informaticiens ivoiriens que je n''ai pu m''empêcher de relayer même si ceblog ne sert pas de site de recherche d''emplois. En effet, le ministère de la fonction publique de Côte d''Ivoire vient d''ouvrir une session derecrute', 1, 0, '2012-03-18 05:59:08', '2012-05-27 06:04:48'),
(26, 'Pourquoi je fais tout ceci en Afrique ?', 'pourquoi-je-fais-tout-ceci-en-afrique', 'http://feedproxy.google.com/~r/jpehouman/~3/ELvCFbuNOPA/pourquoi-je-fais-tout-ceci-en-afrique', 6, 'http://www.jpehouman.com/wp-content/uploads/2012/03/mobile-300x180.jpg', 'Récemment, j''ai discuté avec un journaliste qui devait faire un sujet sur Akendewa, jokkolabs et d''autres communautés et hub technologiques d''Afrique. Pendant l''interview, il m''a posé une question que jusque là personne ne m''avait posé : "Pourquoi fais-tu', 1, 0, '2012-03-01 06:32:01', '2012-05-27 06:04:54'),
(27, 'Les leaders africains des technologies à suivre sur Twitter : CNN ne parle pas français ?', 'les-leaders-africains-des-technologies-a-suivre-sur-twitter-cnn-ne-parle-pas-francais', 'http://feedproxy.google.com/~r/jpehouman/~3/wL1HOQKQ76E/les-leaders-africains-des-technologies-a-suivre-sur-twitter-cnn-ne-parle-pas-francais', 6, 'http://www.jpehouman.com/wp-content/uploads/2012/02/afrique1-300x251.gif', 'IMPORTANT : Le seul objectif de cet article est de profiter de l''opportunité qu''offre CNN pour faire connaître les personnes qui font des choses remarquables en Afrique Francophone. Loin de moi l''idée de " corriger " l''article de CNN. Ce matin, j''ai décou', 1, 0, '2012-02-29 11:48:46', '2012-05-27 06:05:00'),
(28, 'Découvrez comment les cables sous-marin de l’Internet sont interconnectés dans le monde', 'decouvrez-comment-les-cables-sous-marin-de-l-internet-sont-interconnectes-dans-le-monde', 'http://feedproxy.google.com/~r/jpehouman/~3/pH22VbIrb8k/decouvrez-comment-les-cables-sous-marin-de-linternet-sont-interconnectes-dans-le-monde', 6, '', 'Voici comment des cables sous-marin sont interconnectés pour permettre à Internet d''exister. Vous remarquerez que l''Afrique de l''Ouest possède de nombreux points d''entrée. La palme d''or de la densité de points d''entrée revient à l''Europe du nord et à l''Am', 1, 0, '2012-02-29 05:04:55', '2012-05-27 06:05:06'),
(29, '18 recommendations to those in the African diaspora wanting to get involved in the technology sector back home', '18-recommendations-to-those-in-the-african-diaspora-wanting-to-get-involved-in-the-technology-sector-back-home', 'http://feedproxy.google.com/~r/jpehouman/~3/Z_-5M4ApOc8/18-recommendations-to-those-in-the-african-diaspora-wanting-to-get-involved-in-the-technology-sector-back-home', 6, 'http://www.jpehouman.com/wp-content/uploads/2012/02/diaspora_afrique_retour_recommandation.jpg', 'I wrote this post in . It has been translated by John James (BBC Correspondent, Ivory Coast). John is the guy behind the Drogbas''s Country blog . If you''re part of the African diaspora and you want to do business back home, I''d be one of the first to enco', 1, 0, '2012-02-18 12:06:36', '2012-05-27 06:05:37'),
(55, 'LES REVERS DE LA CHASSE AUX EVADES', 'les-revers-de-la-chasse-aux-evades', 'http://yehnidjidji.blogspot.com/2012/05/les-revers-de-la-chasse-aux-evades.html', 7, '', 'Paru dans l''intelligent d''Abidjan du 22 Mai 2012 Evasion de prisonniers à Korhogo, Katiola, Dimbokro, Agboville, Abidjan... A croire que nos pénitenciers sont de vraies passoires. Pourtant la Maison d''Arrêt et de Correction d''Abidjan (MACA) a été remise à', 1, 0, '2012-05-24 08:22:00', '2012-05-27 06:31:29'),
(56, 'LES INVITATIONS ET MOI', 'les-invitations-et-moi', 'http://yehnidjidji.blogspot.com/2012/05/les-invitations-et-moi.html', 7, 'http://4.bp.blogspot.com/-cGOl-M6xLvo/T74MyhwpMII/AAAAAAAAAdc/fXYcXfEG7rg/s72-c/argent.jpg', 'Les gens se fâchent souvent parce que je n''honore pas leurs invitations. Je souhaite expliquer l''une des raisons de ces refus. J''ai toujours eu deux principes auxquels j''essaie de me tenir : ne jamais accepter une invitation qui va nécessiter des dépenses', 1, 0, '2012-05-24 06:27:00', '2012-05-27 06:31:31'),
