(118, 'Cote d''Ivoire: Government  Ethics Charter', 'cote-d-ivoire-government-ethics-charter', 'http://feedproxy.google.com/~r/Nnenna/~3/PABPcnZitJU/cote-divoire-government-ethics-charter.html', 8, '', 'The Ministerial function represents a very important public responsibility at State level. It is based on confidence, on one hand, between the sovereign people of Côte d''Ivoire and the President of the Republic and, on the other, between the President of ', 1, 0, '2011-08-09 15:59:00', '2012-05-27 08:32:51'),
(119, 'Is Abidjan back? De retour à Abidjan', 'is-abidjan-back-de-retour-a-abidjan', 'http://feedproxy.google.com/~r/Nnenna/~3/jEHv7pZkWU0/is-abidjan-back-de-retour-abidjan.html', 8, '', 'Je suis rentrée à Abidjan. J''écris de la maison sur ce vieux divan qui me connait tant! Il y a pas mal de poussière mais .. bof! C''est chez moi. Quand la voiture s''est garée avec mes 4 valises et deux autres sacs, tous les gardiens du quartier ont "fait m', 1, 0, '2011-06-22 15:40:00', '2012-05-27 08:32:54'),
(120, 'Travel by phone:  how ICT adds zest to my life!', 'travel-by-phone-how-ict-adds-zest-to-my-life', 'http://feedproxy.google.com/~r/Nnenna/~3/12MhTNuO6b4/travel-by-phone-how-ict-adds-zest-to-my.html', 8, '', 'Yesterday I did a different kind of travel. I traveled through the greater Accra, the Central, the Eastern and finally the Western regions of Ghana. All the time, seated in front of my computer, doing research, and drafting a paper for an African-Union re', 1, 0, '2011-05-31 03:21:00', '2012-05-27 08:32:55'),
(121, 'Africa, Nigeria, and the likes of John Campbell', 'africa-nigeria-and-the-likes-of-john-campbell', 'http://feedproxy.google.com/~r/Nnenna/~3/idi6chAlLUQ/africa-nigeria-and-likes-of-john.html', 8, '', 'On September 9, 2010, John Campbell wrote an article titled: Nigeria on the Brink: What happens if the 2011 elections fail? in which he began by saying: The 2011 elections in Nigeria, scheduled for January 22, pose a threat to the stability of the United ', 1, 0, '2011-05-19 08:14:00', '2012-05-27 08:32:56'),
(122, 'La guerre de Babi: ou quand le soleil se couche à midi. (En Franco-Ivoiro-Nouchi)', 'la-guerre-de-babi-ou-quand-le-soleil-se-couche-a-midi-en-franco-ivoiro-nouchi', 'http://feedproxy.google.com/~r/Nnenna/~3/U_2tdLr6aY4/la-guerre-de-babi-ou-quand-le-soleil-se.html', 8, '', 'Djiàà c''est ça même kon appel la guerre. Pouatate! Mon vieux, Abidjan a prit drap dêh! Moi j''ai vu pour Guei Robert. Suis allé à Adjame pour prendre pour moi par apport à la fête de noêl quoi. Et les môgos on du gratter de là où on était pour rentrer à pi', 1, 0, '2011-04-03 07:54:00', '2012-05-27 08:32:57'),
(123, '#CIV2010 – Hash tag or Hate tag?', 'civ2010-hash-tag-or-hate-tag', 'http://feedproxy.google.com/~r/Nnenna/~3/iie3hpnOues/civ2010-hash-tag-or-hate-tag.html', 8, '', 'The tag was kicked off on Twitter around October 2010. The idea was to get citizens interested in the upcoming elections to use it. So we used it as a monitoring tag for the campaigns and all the surrounding issues of the first presidential elections in t', 1, 0, '2011-04-03 06:16:00', '2012-05-27 08:32:58'),
(124, 'ODE A LA COTE D''IVOIRE', 'ode-a-la-cote-d-ivoire', 'http://feedproxy.google.com/~r/Nnenna/~3/BjIvE1Ohds0/ode-la-cote-divoire.html', 8, 'https://lh4.googleusercontent.com/-jZDZL7vvomU/TWke_eYVBeI/AAAAAAAAAEY/fat7-arD_MY/s72-c/CIV.png', 'Il s''agissait des alarmes Et nous voici plein de larmes Côte d''Ivoire se trouve en armes Nous assistons la mort dans l''âme Il ne s''agit plus des jeux Ou encore un jeu des mots Il ne s''agit plus d''ADO Ou encore Laurent Gbagbo Après tout ce temps d''attente ', 1, 0, '2011-02-26 10:45:00', '2012-05-27 08:32:59'),
(126, 'The next African leaders to quit power', 'the-next-african-leaders-to-quit-power', 'http://feedproxy.google.com/~r/Nnenna/~3/PqAJD4ffKIE/next-african-leaders-to-quit-power.html', 8, '', 'It is the beginning of February 2011. Tunisia has kicked off the year in grand style. Now the Egyptians are also protesting, asking that their President Hosni Mubarak leave power. Despite all that he has ceded and agreed to cede, the people still want him', 1, 0, '2011-02-06 13:15:00', '2012-05-27 08:33:00'),
(127, 'Who will jail web democracy in Africa?', 'who-will-jail-web-democracy-in-africa', 'http://feedproxy.google.com/~r/Nnenna/~3/U5RU3bZcjew/who-will-jail-web-democracy-in-africa.html', 8, '', 'Last year, on one of the evenings of the FIFA Soccer World Cup in South Africa, Arch Bishop Desmond Tutu came to speak to a group of us. A garden filled with media people from all over the world.', 1, 0, '2011-02-04 08:17:00', '2012-05-27 08:33:02'),
(128, 'People''s Democratic Party - PDP (Nigeria) Presidential Primaries.', 'people-s-democratic-party-pdp-nigeria-presidential-primaries', 'http://feedproxy.google.com/~r/Nnenna/~3/SB0osA2jlmk/peoples-democratic-party-pdp-nigeria.html', 8, 'http://badge.facebook.com/badge/513723363.4660.789650757.png', 'Here are the figures captured on Thursday''s primaries at the Eagle Square Abuja as teh state delegates votes were being counted. The third Candidate, Mrs Sarah Jubril only had her own vote. So please start the count with Sarah Jubril 1 vote in Kwara State', 1, 0, '2011-01-13 23:55:00', '2012-05-27 08:33:04'),
(129, 'Will power sharing work in Côte d''Ivoire?  10 critical questions.', 'will-power-sharing-work-in-cote-d-ivoire-10-critical-questions', 'http://feedproxy.google.com/~r/Nnenna/~3/KmM2eiowCWo/will-power-sharing-work-in-cote-divoire.html', 8, '', 'Elections for the presidential run off took place in Côte d''Ivoire on Sunday the 28th of November. A curfew was set in place two days before. It is the 10th of November today. What the country has is double of what they voted for: 2 Presidents, 2 Prime Mi', 1, 0, '2010-12-10 04:30:00', '2012-05-27 08:33:05');
